            <p className='dailyview__head viewhead'>DAILY</p>
            <div>
                {sContext.CurrentDaily && sContext.CurrentDaily.dailyItemItemsImages.map((item, i) => {
                    return <img src={item} style={{height: '50px', width: '50px'}}/>
                })}
                {sContext.CurrentDaily && sContext.CurrentDaily.dailyItemfinalPrices.map((item, i) => {
                    return <p>{item}</p>
